(27, 0, NULL, 'Privacy', '<p><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">It is &rdquo;Paroshi Ecosystem Limited&rdquo; policy to respect your privacy regarding any information we may collect while operating our website. This Privacy Policy applies to </span><a href=\"https://paroshi.com/\"><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;;\">https://paroshi.com</span></a><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\"> (hereinafter, \"us\", \"we\", or \"</span><a href=\"https://paroshi.com/\"><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;;\">https://paroshi.com</span></a><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">\"). We respect your privacy and are committed to protecting personally identifiable information you may provide us through the Website. We have adopted this privacy policy (\"Privacy Policy\") to explain what information may be collected on our Website, how we use this information, and under what circumstances we may disclose the information to third parties. This Privacy Policy applies only to information we collect through the Website and does not apply to our collection of information from other sources. This Privacy Policy, together with the Terms and conditions posted on our Website, set forth the general rules and policies governing your use of our Website. Depending on your activities when visiting our Website, you may be required to agree to additional terms and conditions.</span></p>\r\n<h3><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Website Visitors</span></h3>\r\n<p><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Like most website operators, we collect non-personally-identifying information of the sort that web browsers and servers typically make available, such as the browser type, language preference, referring site, and the date and time of each visitor request. Our purpose in collecting non-personally identifying information is to better understand how our visitors use its website. From time to time, we may release non-personally-identifying information in the aggregate, e.g., by publishing a report on trends in the usage of its website. We also collect potentially personally-identifying information like Internet Protocol (IP) addresses for logged in users and for users leaving comments on </span><a href=\"https://paroshi.com/\"><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;;\">https://paroshi.com</span></a><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\"> blog posts. We only discloses logged in user and commenter IP addresses under the same circumstances that it uses and discloses personally-identifying information as described below. Gathering of personally-identifying information</span></p>\r\n<p><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">certain visitors to our website choose to interact with us in ways that require us to gather personally-identifying information. The amount and type of information that we gather depends on the nature of the interaction. For example, we ask visitors who sign up for a blog/website at </span><a href=\"https://paroshi.com/\"><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;;\">https://paroshi.com</span></a><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\"> to provide a username, email address, various other information required for website purpose. The information provided by the user is provided to use our services on the website. User has control to clean/delete the profile just as he/she has added the information.</span></p>\r\n<h3><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Security</span></h3>\r\n<p><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">The security of your Personal Information is very important to us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While we strive to use commercially acceptable means to protect your Personal Information, we cannot guarantee its absolute security.</span></p>\r\n<h3><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Advertisements</span></h3>\r\n<p><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Ads appearing on our website may be delivered to users by advertising partners, who may set cookies. These cookies allow the ad server to recognize your computer each time they send you an online advertisement to compile information about you or others who use your computer. This information allows ad networks to, among other things, deliver targeted advertisements that they believe will be of most interest to you. This Privacy Policy covers the use of cookies by us and does not cover the use of cookies by any advertisers.</span></p>\r\n<h3><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Links To External Sites</span></h3>\r\n<p><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Our Service may contain links to external sites that are not operated by us. If you click on a third party link, you will be directed to that third party&rsquo;s site. We strongly advise you to review the Privacy Policy and terms and conditions of every site you visit. We have no control over, and assume no responsibility for the content, privacy policies or practices of any third party sites, products or services. </span><a href=\"https://paroshi.com/\"><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;;\">https://paroshi.com</span></a><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\"> uses Google AdWords/Facebook/3rdParty adverstising services. For remarketing we use the remarketing services to advertise on third party websites (including Google, facebook, etc) to previous visitors to our site. It could mean that we advertise to previous visitors who haven&rsquo;t completed a task on our site. For example, using the contact form to make an enquiry. This could be in the form of an advertisement on the google,facebook search results page, or a site in the Google display network. Third-party vendors, including Google, use cookies to serve ads based on someone&rsquo;s past visits. Of course, any data collected will be used in accordance with our own privacy policy and Google&rsquo;s,Facebook&rsquo;s privacy policy or 3rdparty website. You can set preferences for how Google advertises to you using the Google Ad Preferences page, and if you want to you can opt out of interest-based advertising entirely by cookie settings or permanently using a browser plugin. Further advertising companies provide method to customzie preferences on their interface. We recommend using them. Protection of certain personally-identifying information we discloses potentially personally-identifying and personally-identifying information only to those of its employees, contractors and affiliated organizations that (i) need to know that information in order to process it on our behalf or to provide services available at our website, and (ii) that have agreed not to disclose it to others. Some of those employees, contractors and affiliated organizations may be located outside of your home country; by using our website, you consent to the transfer of such information to them. We will not rent or sell potentially personally-identifying and personally-identifying information to anyone. Other than to its employees, contractors and affiliated organizations, as described above, we disclose potentially personally-identifying and personally-identifying information only in response to a subpoena, court order or other governmental request, or when we believe in good faith that disclosure is reasonably necessary to protect the property or rights of our company, third parties or the public at large. If you are a registered user of </span><a href=\"https://paroshi.com/\"><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;;\">https://paroshi.com</span></a><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\"> and have supplied your email address, we may occasionally send you an email to tell you about new features, solicit your feedback, or just keep you up to date with what is going on with &ldquo;Paroshi Ecosystem Limited&rdquo; and our products. We primarily use our blog to communicate this type of information, so we expect to keep this type of email to a minimum. If you send us a request (for example via a support email or via one of our feedback mechanisms), we reserve the right to publish it in order to help us clarify or respond to your request or to help us support other users. We take all measures reasonably necessary to protect against the unauthorized access, use, alteration or destruction of potentially personally-identifying and personally-identifying information.</span></p>\r\n<h3><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Aggregated Statistics</span></h3>\r\n<p><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">We may collect statistics about the behavior of visitors to its website. We may display this information publicly or provide it to others. However, we does not disclose your personally-identifying information.</span></p>\r\n<h3><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Affiliate Disclosure</span></h3>\r\n<p><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">This site may uses affiliate links and does earn a commission from certain links. This does not affect your purchases or the price you may pay.</span></p>\r\n<h3><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">Cookies</span></h3>\r\n<p><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">To enrich and perfect your online experience, we use \"Cookies\", similar technologies and services provided by others to display personalized content, appropriate advertising and store your preferences on your computer. A cookie is a string of information that a website stores on a visitor&rsquo;s computer, and that the visitor&rsquo;s browser provides to the website each time the visitor returns. We uses cookies to help us identify and track visitors, their usage of<span style=\"mso-spacerun: yes;\">&nbsp; </span></span><a href=\"https://paroshi.com/\"><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;;\">https://paroshi.com</span></a><span style=\"font-size: 11.5pt; font-family: &rsquo;Andalus&rsquo;,&rsquo;serif&rsquo;; color: black;\">, and their website access preferences. Our visitors who do not wish to have cookies placed on their computers should set their browsers to refuse cookies before using our websites, with the drawback that certain features of our websites may not function properly without the aid of cookies. By continuing to navigate our website without changing your cookie settings, you hereby acknowledge a