(46, 0, NULL, 'About Us', '<p>[CompanyName]... has been started Mr.ABC Contact or ABC Company to serve the community at large.</p>\r\n<p>We offer unmatched experience for bride &amp; Grooms on our portal for match &amp; commuicating.</p>\r\n<p>We are customer &amp; Internet centric company.We believe the matrimonial matches are made in heaven but they have to be faciliated on earth by some one, [CompanyName] is a key player to help your for the same. Our portal offer attractive features</p>\r\n<ul>\r\n<li>Easy Registration</li>\r\n<li>Privacy for Safety</li>\r\n<li>Attractive &amp; Affordable Membership Plans</li>\r\n<li>Search with various options including partner preferences</li>\r\n<li>Auto match</li>\r\n</ul>\r\n<p>In order to grow our team compromises various professionals with a clear focus on technology. Our focus is clearly on providing finest search &amp; matches from world over.So when you are seeking your life partner seek with us.</p>\r\n<p>We have easy to use search, start exploring now. Further we have attractive membership plan, get in touch with our support team to help you select best match offer.</p>', 'cmsimage461501760968.jpg', 0, '2012-04-12', '2018-07-26', 1, 1, '90.0.0.5', '103.58.74.190', 0, 1, 1, 2, NULL, 'this is a aboutus page for demomatrimonial', 1),
