(69, 0, NULL, 'ATTN : LAUNCH OF NEW MATRIMONY LAYOUT', '<p>We are pleased to announce new version of matrimony script . Check the features</p>\r\n<p>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry&rsquo;s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.&nbsp;</p>', 'cmsimage691524042869.jpg', 0, '2014-06-26', '2018-04-18', 1, 1, NULL, '90.0.0.6', 0, 11, 1, NULL, '', NULL, 1),
(99, 0, NULL, 'Safety Tips ', '<p>We recommend to take safety while looking for a match online. As a facilitator, we try to screen &amp; match the best one for you. But we abide with certain limitations when finding out the match for the profile.</p>\r\n<p>So we highly recommend being aware &amp; alert when looking for the match.</p>\r\n<p>&nbsp;</p>\r\n<ul>\r\n<li>Privatize the profile as much as possible. Do not reveal too much information about your workplace, telephone, address</li>\r\n<li>Stay away from the people who ask for money, this could be scam alert.</li>\r\n<li>Use \"Request an Image\" feature</li>\r\n<li>Keep family involved</li>\r\n<li>Do not fall into trap of pressure</li>\r\n<li>When some behave badly - alert us</li>\r\n<li>Never meet the match alone for the first time, involve family.Prefer profiles that are been validated</li>\r\n<li>Keep check, ask questions if required</li>\r\n<li>Before dialing check the number is not having strange code to avoid huge bills.</li>\r\n<li>Use pre-paid mobile number for communicating.</li>\r\n<li>Make sure you log out from the system, once you have used the system.</li>\r\n</ul>\r\n<p>Matrimony is a lifetime decision, So it you to make a decision what is best for you. So take precautionary steps for your safety. In case if you come across the fraudulent profile, somebody harassing, <a href=\"../contactus.php\">Report to us immediately</a>.</p>', 'cmsimage991501681867.jpg', 0, '2017-08-02', '2018-07-23', 1, 1, NULL, '103.58.74.190', 0, 5, 1, NULL, NULL, NULL, 1),
