INSERT INTO `tbldatingemailmaster` (`emailid`, `subject`, `message`, `title`, `currentstatus`, `modifydate`, `modifyby`) VALUES
(1, 'Congrats ! you have registered at [sitename]', '<p><br /> Dear [name] ,</p>\r\n<div class=\"msg Nth\"><br />Welcome to our world. Thanks for creating profile on our website.<br /> <br /> As part of the registration process , we screen every profile to ensure it meets our terms of use &amp; give our community a good experience.<br /> <br /> Once your screening is completed you may log on to the website using following details<br /> <br /> Login(email): [username]<br /> Pasword: [password]<br />Email verification url (optional): [extramessage]<br /> <br /> To take optimum benefit of our services we recommend you the following.<br /> <br /> a) Update profile ( hobbies, interests, religion &amp; other important details )<br /> b) Update your photos<br /> c) Update partner profile<br /> d) Search &amp; contact<br /> e) Upgrade at your ease<br /> <br /> In case if you need any further assistance please feel free contact our relationship officer by email or phone (details on website)<br /> <br /> We wish you Best Wishes for your parner search on [sitename]<br /> <br /> Regards<br /> <br /> Team [sitename]</div>\r\n<p>&nbsp;</p>', 'Registration mail', 0, '2018-07-23', 1),
(2, 'Inquiry Mail', 'Thanks for inquiry test', 'Inquiry Mail', 0, '2007-03-05', 1),
(4, 'Payment Complete Mail', 'Payment Complete\r\n', 'Payment Complete Mail', 0, NULL, NULL),
(9, 'Match email from [sitename]', '<p><span >Dear [name]<br /><br />Following are new matches matching your partner preferences</span></p>\n\n[extramsg]\n<p>[sitename] Team</p>', 'preffered partner matching email', 0, '2017-05-11', 1),
(6, '[sitename] forgot password', 'Dear [name], <br><br><span style=\"font-weight: bold;\">Following are your login details</span><br><br>Login Id (email): [username]<br>\r\nPasword: [password]<br><br>Team [sitename]<br><br>', 'Forgot Password Mail', 0, '2011-08-27', 1),
(8, 'Your friend has forwarded profile from [sitename]', 'Your friend has forwarded profile from [sitename] <br><br>[website_profile_link]', 'forward profile to friend', 0, '2009-09-19', 1),
(10, 'send phone no request email', '<div class=\"pr_contacts\"><div class=\"pr_contacts_main\"><table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><th scope=\"row\"><label>[bg] :</label></th><td>[name]</td></tr><tr><th scope=\"row\"><label>Contact person :</label></th><td>[contact_person_on_phone]</td></tr><tr><th scope=\"row\"><label>Profile Code :</label></th><td>[profilecode]</td></tr><tr><th scope=\"row\"><label>Relation with [bgr] :</label></th><td>[relation]</td></tr><tr><th scope=\"row\"><label>Mobile No. :</label></th><td>[mobileno]</td></tr><tr><th scope=\"row\"><label>Landline No. :</label></th><td>[phoneno]</td></tr><tr><th scope=\"row\"><label>Calling Time :</label></th><td>[callingtime]</td></tr><tr><th scope=\"row\"><label>Address :</label></th><td>[address]</td></tr><tr><th scope=\"row\"><label>Primary E-mail ID :</label></th><td>[email]</td></tr><tr><th scope=\"row\"><label>Alternate E-mail ID :</label></th><td>[altemail]</td></tr><tr><th scope=\"row\"><label>Remarks :</label></th><td>[remarks]</td></tr><tr><th scope=\"row\"><label>Father Name :</label></th><td>[father_name]</td></tr><tr><th scope=\"row\"><label>Mother Name :</label></th><td>[mother_name]</td></tr></tbody></table></div></div>', 'send phone no request email', 0, '2012-01-10', 1),
(11, 'inform member that his/her phone is send to requested member', 'inform member that his/her phone is send to requested member [name] [displayprofilelink]', 'inform member that his/her phone is send to requested member', 0, NULL, NULL),
(12, 'send image request email', 'send image request email<br><br>Please check Received Image Requests<br>', 'send image request email', 0, '2012-04-09', 1),
(13, 'express intrest mail [sitename]', '<br>\r\nDear [receivername],<br><br>Following member has expressed interest in your profile.<br><br><div style=\"text-align: left;\">[sendername]<br>\r\n[senderimage]<br>\r\n<a href=\"%5Bsenderlink%5D\">click here to view profile</a><br><br><br><br>\r\n<br>\r\n<br><a href=\"%5Bacceptlink%5D\">click here to accept</a> | <a href=\"%5Bdeclinedlink%5D\">click here to declined</a><br></div><br>We highly recommend to upgrade to our premium services to get in touch with the candidate<br><br>In case if you need any further assistance please feel free contact our relationship officer by email or phone (details on website)<br><br>We wish you Best wishes for your parner search on [sitename]<br><br>Regards<br><br>Team [sitename]<br>\r\n', 'express intrest mail (for PMB only)', 0, '2013-05-16', 1),
(14, 'Your profile is viewed by other member of site', 'Dear [receivername],\r\nfollowing member just viewed your profile\r\n<br>\r\n[senderimage]<br>[profile_details]<br><br>\r\n<a href=\"[senderlink]\">click here to view profile</a><br>\r\n', 'Your profile is viewed by other member of site', 0, '2010-12-07', 1),
(15, 'send profile to friend', 'send profile to friend [website_profile_link]', 'send profile to friend', 0, NULL, NULL),
(16, 'new payment receive', 'new payment receive', 'new payment receive this mail goes to admin', 0, NULL, NULL),
(22, 'send manyata seal message to member for whom package is buy', 'send manyata seal message to member for whom package is buy', 'send manyata seal message to member for whom package is buy', 0, NULL, NULL),
(17, 'profile update reminder mail', '<p><span style=\"font-family: Arial;\">Dear [name]</span>,</p>\r\n<p>We at [sitename] strive to get best user experience. All our basic profiles goes under screening.Based on the process<br />email or mobile is verified. To maintain best quality data delete the in-appropriate profiles.</p>\r\n<p>But as a user we would like to inform you that few users still may provide wrong or incorrect information &amp; misrepresent the information &amp; get their profile available on the website.We recommend the user to remain alert, use their judgment when considering the another person genuiness &amp; marriage interests.</p>\r\n<p>We strongly recommend users to beware of the following</p>\r\n<ul>\r\n<li>&nbsp;Remain alert with the personal information about another user.</li>\r\n<li>&nbsp;Report if another member is asking any kind of personal favour or money.</li>\r\n<li>&nbsp;Never share login details with any other user. Our team members do not ask for p***word.</li>\r\n<li>&nbsp;Always check of the website url before logging into the system.</li>\r\n<li>&nbsp;Always dual check the profile integrity</li>\r\n</ul>\r\n<p>Notify our support team in case if you feel any thing su***ious. Use contact us section to<br />reach our team.</p>\r\n<p>Warm Regards</p>\r\n<p>[sitename]Team<br /><br /></p>', 'profile update reminder mail', 0, '2017-09-06', 1),
(18, 'directory listing has been placed successfully send email to listing owner with modification link', 'directory listing has been placed successfully send email to listing owner with modification link', 'directory listing has been placed successfully send email to listing owner with modification link', 0, NULL, NULL),
(19, 'direcory lost password email', 'direcory lost password email', 'direcory lost password email', 0, NULL, NULL),
(20, 'new registration send email to admin', 'new registration send email to admin', 'new registration send email to admin', 0, NULL, NULL),
(21, 'new inquiry received from contactus ', 'new inquiry received from contactus', 'new inquiry received from contactus', 0, NULL, NULL),
(23, 'Phone Request Mail ', 'Dear [receivername],<br><br><br>Following member has sent request for phone no.<br><br><div style=\"text-align: left;\">[sendername]<br>\r\n[senderimage]<br><br><br><br><br><br>\r\n<a href=\"[senderlink]\">click here to view profile</a><br>\r\n<br>\r\n<a href=\"[acceptlink]\">click here to accept</a> | <a href=\"[declinedlink]\">click here to declined</a><br></div><br>We highly recommend to upgrade to our premium services to get in touch with the candidate<br><br>In case if you need any further assistance please feel free contact our relationship officer by email or phone (details on website)<br><br>We wish you Best wishes for your parner search on [sitename]<br><br>Regards<br><br>Team [sitename]<br>', 'phone request mail', 0, '2010-07-15', 1),
(24, 'Phone Request Reply ', 'Dear [receivername],<br><br>[sendername]  has accepted your request.<br><br>\r\n<div>\r\n<a href=\"[senderlink]\">click here to view Phone No.</a>\r\n<br></div><br>\r\nWe highly recommend to upgrade to our premium services to get in touch with the candidate<br><br>In case if you need any further assistance please feel free contact our relationship officer by email or phone (details on website)<br><br>We wish you Best wishes for your parner search on [sitename]<br><br>Regards<br><br>Team [sitename]<br>', 'phone request reply', 0, '2008-12-15', 1),
(25, 'Phone Request not accepted ', 'Dear [receivername],<br><br>[sendername] has not accepted your request.<br><br>\r\n<br>\r\nWe highly recommend to upgrade to our premium services to get in touch with the candidate<br><br>In case if you need any \r\n\r\nfurther assistance please feel free contact our relationship officer by email or phone (details on website)<br><br>We wish \r\n\r\nyou Best wishes for your parner search on [sitename]<br><br>Regards<br><br>Team [sitename]<br>\r\n', 'Phone Request not accepted', 0, '2008-12-15', 1),
(26, 'request for manyata seal mail to admin', '[profileid1] has requested to get Manyata seal for the memeber with [profileid2].', 'Manyata Seal Mail to Admin', 0, NULL, NULL),
(27, 'Express interest Accepted ', 'Dear [name],\r\n\r\n<br><br>Your express interest has been accepted by [touser].\r\n\r\n\r\n<br><br>Thanks', 'Accept Express interest Email to Sender', 0, '2012-05-21', 1),
(28, 'Express interest Declined', 'Dear [name],\r\n\r\n<br><br>Sorry, Your express interest has been declined from [touser].\r\n\r\n\r\n\r\n\r\n<br><br><br>Thanks', 'Declined Express Interest Email for Sender', 0, '2012-05-21', 1),
(29, 'Wishing you Many Many Happy Returns of the Date', 'Dear [username],\r\n\r\nWishing you Many Many Happy Returns of the Day\r\n\r\n\r\n\r\n\r\nThanks\r\n', 'Birthday Email', 0, NULL, NULL),
(30, 'Express Interest Sent', '<p><span style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 18px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; text-decoration-style: initial; text-decoration-color: initial; display: inline !important; float: none;\">Dear [name], [extramessage]. Thanks</span>.</p>\r\n<p>Team [sitename]</p>', 'Express Interest Sent to Sender', 0, '2017-12-20', 1),
(31, 'Express Interest Received to Receiver', 'Dear [name],\r\n\r\nYou have received express interest from [receivername]\r\n\r\n\r\nThanks', 'Express Interest Received to Receiver', 0, '2013-06-12', 1),
(32, 'Congratulation! Your Image Request is accepted', '<p>Hi [senderusername],<br /><br />Your image has been accepted by [username].<br /><br />[passwordmsg]<br /><br /><br />Thanks</p>', 'Image Request Accepted Email', 0, '2018-07-23', 1),
(33, 'Refer to friend', '<p>Hi,</p>\r\n<p>&nbsp;</p>\r\n<p>Please go through [sitename];</p>\r\n<p>&nbsp;</p>\r\n<p>Thanks</p>\r\n<p>[sendername]</p>', 'Refer to friend', 0, '2014-01-27', 1),
(34, 'Reminder For Express Interest Sent', 'Dear [name],\r\n\r\nYou have sent express interest to [receivername];\r\n\r\n\r\n\r\n\r\nThanks', 'Reminder For Express Interest Sent to Sender', 0, NULL, NULL),
(35, 'Reminder For Express Interest Received to Receiver', 'Dear [name],\r\n\r\nYou have received express interest from [receivername]\r\n\r\n\r\nThanks', 'Reminder For Express Interest Received to Receiver', 0, '2013-06-12', 1),
(36, 'We have a match for you from [sitename]', '<p style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Dear [name] ,</p>\r\n<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">We have &nbsp;a match for you. Preview the details.&nbsp;</div>\r\n<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">If you like any of the profile let us know we will arrange detailed preview of profile.</div>\r\n<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><br />Team [sitename]</div>\r\n<p style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Note : All contacts details require postive credits towards your account for detailed conact preview.</p>', 'favourite list mail', 0, '2017-05-01', 1),
(37, 'Your matchs detailed profile is here from  [sitename]', '<p style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Dear [name] ,</p>\n<p style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Details of the profile you liked are attached.&nbsp;</p>\n<div style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><br />Team [sitename]</div>\n<p style=\"color: #000000; font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 15px; font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Note : Contact details are available only on specific request &amp; are subject to credits available.</p>', 'profile sent mail', 0, '2017-05-01', 1),
(38, 'Package Expiry mail', '<p><span style=\"font-family: Arial;\">Dear [name]</span>,<br /><br />Your [pckname] Package has been expire in [day] days.</p>\r\n<p>renew it.<br /><br />Please update your profile.<br /><br /><br /><br />Thanks<br />[sitename]Team<br /><br /><br /><br /></p>', 'Package Expiry mail', 0, '2017-05-11', 1),
(39, 'Email Verify reminder mail [sitename]', '<p><span style=\"font-family: Arial;\">Dear [name]</span>,</p>\n<br>[extramsg]<br>\n<p>Warm Regards</p>\n<p>[sitename]Team<br /><br /></p>', 'Email Verify reminder mail', 0, '2017-09-06', 1),
(40, 'send phone no request email', '<div class=\"pr_contacts\"><div class=\"pr_contacts_main\"><table width=\"100%\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\"><tbody><tr><th scope=\"row\"><label>[bg] :</label></th><td>[name]</td></tr><tr><th scope=\"row\"><label>Contact person :</label></th><td>[contact_person_on_phone]</td></tr><tr><th scope=\"row\"><label>Profile Code :</label></th><td>[profilecode]</td></tr><tr><th scope=\"row\"><label>Relation with [bgr] :</label></th><td>[relation]</td></tr><tr><th scope=\"row\"><label>Mobile No. :</label></th><td>[mobileno]</td></tr><tr><th scope=\"row\"><label>Landline No. :</label></th><td>[phoneno]</td></tr><tr><th scope=\"row\"><label>Calling Time :</label></th><td>[callingtime]</td></tr><tr><th scope=\"row\"><label>Address :</label></th><td>[address]</td></tr><tr><th scope=\"row\"><label>Primary E-mail ID :</label></th><td>[email]</td></tr><tr><th scope=\"row\"><label>Alternate E-mail ID :</label></th><td>[altemail]</td></tr><tr><th scope=\"row\"><label>Remarks :</label></th><td>[remarks]</td></tr><tr><th scope=\"row\"><label>Father Name :</label></th><td>[father_name]</td></tr><tr><th scope=\"row\"><label>Mother Name :</label></th><td>[mother_name]</td></tr></tbody></table></div></div>', 'send phone no request email', 0, '2012-01-10', 1);
