('AdminMail', 'hello@paroshi.com', 1, 'Admin email', 0, 1, '2009-09-19', 'The email is used to display to send forgot password for admin & is used in all email address sent from the admin', 'Admin', 'N'),
('InvoiceFooter', 'Welcome to Paroshi Club. This is the beginning of a new and glorious journey!<br>\r\n', 2, 'Invoice Footer', 0, 1, '2011-08-27', 'The is displayed at the bottom of the invoice. You can put a small message or contact details you need to give to end user.', 'Content', 'N'),
('CompanyAddress', '</br>\r\nDhaka</br>\r\nBangladesh', 4, 'Company Address', 0, 1, '2009-05-20', 'You can place your address here, which will get reflected in the site at various places', 'Content', 'N'),
('CompanyName', 'paroshi.com', 6, 'Company Name', 0, 1, '2009-05-20', 'Company name comes here', 'Content', 'N'),
('UserCommentAutoApproval', 'Y', 7, 'User Comment Auto Approval(Y/N)', 0, NULL, NULL, 'To put comments on auto approval use \"Y\" & \"N\" to handle it manually from the admin', 'Approval', 'Y'),
