('WaterMarkImageText', 'paroshi.com', 19, 'Water Mark Image Text', 0, 1, '2012-11-16', 'Ideally a domain name is used to watermark the image.', 'Image', 'N'),
('SocialBookMarkCode', '<!-- AddThis Button BEGIN -->\r\n<div class=\"addthis_toolbox addthis_default_style\">\r\n<a href=\"http://www.addthis.com/bookmark.php?v=250&username=xa-4c29fd2a723fb82e\" class=\"addthis_button_compact\"></a>\r\n<span class=\"addthis_separator\">|</span>\r\n<a class=\"addthis_button_facebook\"></a>\r\n<a class=\"addthis_button_myspace\"></a>\r\n<a class=\"addthis_button_google\"></a>\r\n<a class=\"addthis_button_twitter\"></a>\r\n</div>\r\n<script type=\"text/javascript\" src=\"http://s7.addthis.com/js/250/addthis_widget.js#username=xa-4c29fd2a723fb82e\"></script>\r\n<!-- AddThis Button END -->\r\n', 20, 'Social Book Mark Code', 0, 1, '2010-07-12', 'We recommend using the social bookmarking service.You may use the default code for the same.  (eg:addthis.com) ', 'Web 2.0', 'N'),
