('partnerprofilemailsenddate', '2017-05-10', 56, 'partnerprofilemailsenddate', 1, NULL, NULL, 'This is date that is used to check profile email date  has been sent on. ', 'General', 'N'),
('PhnoeRequestAllowedToFreeMember', 'N', 57, 'phnoe request allowed to free member (Y/N)', 1, NULL, NULL, 'To allow the phone request for free members use \"Y\" & \"N\" to not allow it', 'Plug-In', 'N'),
('ProfileIdInitials_method', 'P', 69, 'Profile code style [M: memeber name initial,S: static initial]', 0, 1, '2010-06-29', 'To alllow the profile code as member name use \"M\" & \"S\" is used for static initial', 'General', 'N'),
('profile_update_mail_days', '2', 60, 'profile update mail send  in no of days', 0, 1, NULL, 'After this amount of days users receives a email that he needs to update the profile', 'Cron', 'N'),
