('Directory_listing_price', '100', 62, 'Directory listing price', 0, NULL, NULL, 'This the directory listing price for paid members', 'Directory', 'N'),
('Email_Message_Design', '<style type=\"text/css\">\r\nbody{\r\n	height:100%;\r\n	margin:0;\r\n	padding:0;\r\n	width:100%;\r\n}\r\n\r\n</style>\r\n\r\n<div style=\"border-top:solid 3px #3f51b5 ; background-color:#EFEFEF;\"><div align=\"center\" style=\"background-color:#FFF;padding: 18px 0px;\"><img src=\"https://www.paroshi.com/uploadfiles/site_default5/sitelogo.png\" border=\"0\" /></div>\r\n<div style=\"font-family:Arial, Helvetica, sans-serif;     padding: 16px;\">[email_message]</div></div>', 63, 'Email Message html Design(pls use [email_message] to replace with message)', 0, 1, '2013-01-29', 'This is email design, ideally you changes the logo link & background color code for customized email design as per your requirement', 'Email', 'N'),
('Dashboard_main_note', '-You may use this are to put important notes', 64, 'do not update', 1, 1, '2017-08-01', 'This is for administrator usage, the important note couple placed & is displayed on admin dashboard', 'General', 'N'),
('HomePage_Meta', '<title>Welcome</title>\r\n    <meta name=\"description\" content=\"Matrimonial Website Service\">\r\n    <meta name=\"keywords\" content=\"Matrimonial website, marriage website, matchmaking website, shaadi site\">\r\n       <meta name=\"Robots\" content=\"INDEX,FOLLOW\">\r\n    <meta name=\"Revisit-after\" content=\"7 Days\">', 65, 'Home Page Meta tags', 0, 1, '2010-09-07', 'You may customize the title & meta tags for home page, this is very important for search engine placements.You may put 100 characters in title with 3 keywords in title. Description with 250 characters describing the service of yours with important keywords. In keywords tags you may use 12 keywords maximum (lesser is better ) with comma & space to be used as seperator', 'SEO', 'N'),
('Webstats_code', '', 66, 'Webstats code', 0, 1, '2009-06-03', 'You can put in any third party web stats service code this 3rd party integration will provide insight of user visitors.', 'SEO', 'N'),
('Logo_link', 'https://www.paroshi.com/index.php', 67, 'do not update', 1, 1, '2018-10-15', 'Put in the url of the site', 'DESIGN', 'N'),
