('Thumbnil_Image_Width', '150', 70, 'Thumbnil Image Width', 0, 1, '2009-08-28', 'Do not change this', 'Image', 'N'),
('Directory_payment_method', 'P', 71, 'Directory payment method[P:paypal;C:ccavenue]', 0, 1, '2009-05-20', 'Configure your directory payment gateway', 'Directory', 'N'),
