(1, 'Identity Badge', 'Identity Badge is awarded to user you have have verified as per the norms by providing two valid ID. This documents has to be self\nverified. As a Management we reserve the right to reject the document & ask for addional document. Upon verfication the badge is awarded to the user.', 'Please upload the document copy that is visibile, By uploading the document you are legally binded to our terms that you are supplying correct & Valid documents.All documents should be of less than 1 MB.', 'Y,Enter Document No', 'Y,Upload File', 'Y,Select Document Type', 'Badge-Identity.jpg', NULL, 'Badge-Identity.jpg', 'mem', 0, NULL, NULL, NULL, NULL, NULL, NULL),
(2, 'Professional Badge', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever', 'Please upload the document copy that is visibile, By uploading the document you are legally binded to our terms that you are supplying correct & Valid documents.All documents should be of less than 1 MB.', 'Y', 'N', 'N', 'Badge-Education.jpg', NULL, NULL, NULL, 3, NULL, NULL, NULL, NULL, NULL, NULL),
(3, 'Professional Badge', 'EDUPRO Badge is awarded to user you have have verified the educational & professional documents. This documents has to be self verified. As a Management we reserve the right to reject the document & ask for addional document. Upon verfication the badge is awarded to the user.', 'Please upload the document copy that is visibile, By uploading the document you are legally binded to our terms that you are supplying correct & Valid documents.All documents should be of less than 1 MB.', 'Y,Enter Document No', 'Y,Upload File', 'Y,Select Document Type', 'Badge-Education.jpg', NULL, 'Badge-Education.jpg', 'free', 0, NULL, NULL, NULL, NULL, NULL, NULL),
(4, 'Reference Badge', 'Reference Badge is awarded to the user who have verified two website with two of its friends or relatives or proffessional collegues. This documents has to be self verified. As a Management we reserve the right to reject the document & ask for addional document. Upon verfication the badge is awarded to the user.', 'Please upload the document copy that is visibile, By uploading the document you are legally binded to our terms that you are supplying correct & Valid documents.All documents should be of less than 1 MB.', 'N', 'Y,Upload Reference Letter', 'N', 'Badge-Reference.jpg', NULL, 'Badge-Reference.jpg', 'free', 0, NULL, NULL, NULL, NULL, NULL, NULL),
(5, 'Social Badge', 'Social Badge is awarded to the user who has provided two full loaded social profiels namely Facebook & LinkedIn. You will have add our account as a friend & we verify your profile.As a Management we reserve the right to reject the document & ask for addional urls.Upon verfication the badge is awarded to the user.', 'Please upload the document copy that is visibile, By uploading the document you are legally binded to our terms that you are supplying correct & Valid documents.All documents should be of less than 1 MB.', 'Y,Enter URL', 'N', 'Y,Select Type', 'Badge-Social.jpg', NULL, 'Badge-Social.jpg', 'free', 0, NULL, NULL, NULL, NULL, NULL, NULL);
