INSERT INTO `tblkb_quemaster` (`cmsid`, `categoryid`, `privacyid`, `Title`, `Description`, `thumb_up`, `thumb_down`, `img_path`, `ImgNm`, `View`, `email`, `CreateDate`, `ModifyDate`, `CreateBy`, `ModifyBy`, `CreateIP`, `ModifyIP`, `CurrentStatus`, `meta_keywords`, `Meta_desc`) VALUES
(1, 1, 1, 'This is question', 'This is test', NULL, NULL, 'http://90.0.0.8/work2015/DemoMatrimony/uploadfiles/cmsupload_path931.jpg', NULL, 0, NULL, '2016-12-28', NULL, 1, NULL, '90.0.0.39', NULL, 1, NULL, NULL),
(2, 1, 1, 'Only Logged in users can see Private Que-Ans.', 'Please enter summary here. It will also used as description for meta tags.\r\nPlease do not put more than 150 characters.', NULL, NULL, NULL, NULL, 0, NULL, '2017-05-27', NULL, 1, NULL, '90.0.0.5', NULL, 1, NULL, NULL),
(3, 1, 1, 'How can i contact customer care.', 'We are eager to help, you can contact us from the support request form.', NULL, NULL, NULL, NULL, 0, NULL, '2017-08-02', NULL, 1, NULL, '90.0.0.8', NULL, 0, NULL, NULL),
(4, 1, 1, 'How can I upgrade.', 'Check out membership page, choose the membership package that is ideal for \r\nyou. We recommend packages of 1 year validity atleast to get the maximum \r\nout of website.', NULL, NULL, NULL, NULL, 0, NULL, '2017-08-02', NULL, 1, NULL, '90.0.0.8', NULL, 0, NULL, NULL),
(5, 1, 1, 'What are the benefits of upgrade.', 'There are lot of features that upgrade membership gets. The major benefit \r\nis you recieve the contact credits that used to preview contact details \r\nof the user', NULL, NULL, NULL, NULL, 0, NULL, '2017-08-02', NULL, 1, NULL, '90.0.0.8', NULL, 0, NULL, NULL),
(6, 1, 1, 'Can I change DOB & Gender.', 'No you can not change the DOB & Gender. In case if you have wrongly entered\r\nyou need to send a support request.', NULL, NULL, NULL, NULL, 0, NULL, '2017-08-02', NULL, 1, NULL, '90.0.0.8', NULL, 0, NULL, NULL),
(7, 1, 1, 'Can I register multiple with same email ID.', 'No you can not register multiple account with same email id.', NULL, NULL, NULL, NULL, 0, NULL, '2017-08-02', NULL, 1, NULL, '90.0.0.8', NULL, 0, NULL, NULL),
(8, 1, 1, 'What is ideal way to use the site.', '<ul>\r\n   <li> 1. Complete full profile </li>\r\n   <li> 2. upload pictures as required </li>\r\n   <li> 3. Based on your partner preference make a search</li>\r\n   <li> 4. Short list the candidates </li>\r\n   <li> 5. Send express interest </li>\r\n   <li> 6. Check contact details </li>\r\n   <li> 7. Contact the user & arrange a meeting </li>\r\n<ul>\r\n</br></br>\r\n<p>Note : Make sure you use our safety tips & prudence</p>', NULL, NULL, NULL, NULL, 0, NULL, '2017-08-02', '2017-08-02', 1, 1, '90.0.0.8', '90.0.0.8', 0, NULL, NULL);
